import { StyleSheet } from "react-native";

const styles = StyleSheet.create({

    container: {
      
      margin: 0,
      flex: 1,
      padding: '5%',
  
      alignItems: 'center',
      justifyContent: 'flex-start',
  
      backgroundColor: '#fff',
      width: '100%',
      height: '100%',
  
    },
  
  
  });

  export default styles;
